  <style>
    @import url('https://fonts.googleapis.com/css2?family=Poppins:wght@100;200;300;400;500;600;700;800;900&display=swap');

    html {
      box-sizing: border-box;
      font-family: 'Poppins', sans-serif;
    }

    *,
    *::after,
    *::before {
      box-sizing: inherit;
      margin: 0;
      padding: 0;
    }

    .option {}

    .containerxd {
      display: inline-flex;
      justify-content: center;
      align-items: flex-start;
      padding-right: 0px;
      padding-bottom: 10px;
    }

    .menu {
      display: grid;
      grid-template-rows: 40px max-content;
      gap: 10px;

    }

    .bx-x {
      color: white;
      font-size: 25px
    }

    .toggle {
      all: unset;
      background-color: dodgerblue;
      color: white;
      width: 100px;
      padding-left: 5px;
      padding: 10px;
      font-weight: 700;
      display: flex;
      justify-content: space-between;
      align-items: center;
      border-radius: 10px;
      cursor: pointer;
      right: 10px;
    }

    .btnxd {
      all: unset;
      background-color: dodgerblue;
      color: white;
      width: 100px;
      padding: 8px;
      font-weight: 700;
      display: flex;
      justify-content: space-between;
      align-items: center;
      border-radius: 10px;
      cursor: pointer;
      right: 10px;
    }

    .toggle::after {
      content: "";
      width: 6px;
      height: 6px;
      border-width: 0 3px 3px 0;
      border-style: solid;
      transform: rotate(45deg);
      transition: 0.4s;
    }

    .list {
      background-color: white;
      color: #444;
      list-style: none;
      display: grid;
      grid-template-rows: repeat(8px, 40px);
      border-radius: 10px;
      overflow: hidden;
      height: 0;
      transition: 0.4s;
    }

    .list-item {
      display: flex;
      align-items: center;
      padding-left: 5px;
      transition: 0.4s, transform 0.4s var(--delay);
      transform: translateX(-100%);
      user-select: none;
      cursor: pointer;
      height: 40px;
    }

    .list-item:hover {
      background-color: dodgerblue;
      color: #fff;
    }

    .toggle:focus::after {
      transform: rotate(225deg);
    }

    .toggle:focus~.list {
      height: 100%;
    }

    .toggle:focus~.list .list-item {
      transform: translateX(0);
    }

    /* New class to toggle the menu state */
    .menu.opened .list {
      height: 100%;
    }

    .menu.opened .toggle::after {
      transform: rotate(225deg);
    }

    .menu.opened .list-item {
      transform: translateX(0);
    }
  </style>
